/* Read ROM image file */
int InfoNES_ReadRom( const char *pszFileName )
{
/*
*  Read ROM image file
*
*  Parameters
*    const char *pszFileName          (Read)
*
*  Return values
*     0 : Normally
*    -1 : Error
	*/
	
	xnes_peer_file *fp;
	Nes_Global_T *pGData = &gNesGlobalData;
	
	/* Open ROM file */
	fp = (xnes_peer_file *)(g_nes_ctx.xnes_peer_fopen_4_read)( pszFileName );
	if ( fp == NULL )
		return -1;
	
	/* Read ROM Header */
	g_nes_ctx.xnes_peer_file_read( &NesHeader, sizeof NesHeader * 1, fp );
	if ( memcmp( NesHeader.byID, "NES\x1a", 4 ) != 0 )
	{
		/* not .nes file */
		g_nes_ctx.xnes_peer_file_close( fp );
		return -1;
	}
	
	/* Clear SRAM */
	memset( pGData->SRAM, 0, NES_SRAM_SIZE );
	
	/* If trainer presents Read Triner at 0x7000-0x71ff */
	if ( NesHeader.byInfo1 & 4 )
	{
		g_nes_ctx.xnes_peer_file_read( &pGData->SRAM[ 0x1000 ], 512 * 1, fp );
	}
	
	/* Allocate Memory for ROM Image */
	pGData->ROM = (BYTE *)NesMallocFromWRE( NesHeader.byRomSize * 0x4000 );
	
	/* Read ROM Image */
	g_nes_ctx.xnes_peer_file_read( pGData->ROM, 0x4000 * NesHeader.byRomSize, fp );
	
	if ( NesHeader.byVRomSize > 0 )
	{
		/* Allocate Memory for VROM Image */
		pGData->VROM = (BYTE *)NesMallocFromWRE( NesHeader.byVRomSize * 0x2000 );
		
		/* Read VROM Image */
		g_nes_ctx.xnes_peer_file_read( pGData->VROM, 0x2000 * NesHeader.byVRomSize, fp );
	}
	
	/* File close */
	g_nes_ctx.xnes_peer_file_close( fp );
	
	/* Successful */
	return 0;
}

/* Release a memory for ROM */
void InfoNES_ReleaseRom()
{
/*
*  Release a memory for ROM
*
	*/	
	Nes_Global_T *pGData = &gNesGlobalData;
	
	if ( pGData->ROM )
	{
		NesFreeFromWRE( pGData->ROM );
		pGData->ROM = NULL;
	}
	
	if ( pGData->VROM )
	{
		NesFreeFromWRE( pGData->VROM );
		pGData->VROM = NULL;
	}
}


int InfoNES_SaveSRAM( const char* szSaveName )
{
/*
*  Save a SRAM
*
*  Return values
*     0 : Normally
*    -1 : SRAM data couldn't be written
	*/
	
	xnes_peer_file *fp;
	int nUsedTable[ 256 ];
	unsigned char chData;
	unsigned char chPrevData;
	unsigned char chTag;
	int nIdx;
	int nEncoded;
	int nEncLen;
	int nRunLen;
	unsigned char pDstBuf[ NES_SRAM_SIZE ];
	Nes_Global_T *pGData = &gNesGlobalData;
	
	/*-------------------------------------------------------------------*/
	/*  Compress a SRAM data                                             */
	/*-------------------------------------------------------------------*/
	
	memset( nUsedTable, 0, sizeof nUsedTable );
	
	for ( nIdx = 0; nIdx < NES_SRAM_SIZE; ++nIdx )
	{
		++nUsedTable[ pGData->SRAM[ nIdx++ ] ];
	}
	for ( nIdx = 1, chTag = 0; nIdx < 256; ++nIdx )
	{
		if ( nUsedTable[ nIdx ] < nUsedTable[ chTag ] )
			chTag = nIdx;
	}
	
	nEncoded = 0;
	nEncLen = 0;
	nRunLen = 1;
	
	pDstBuf[ nEncLen++ ] = chTag;
	
	chPrevData = pGData->SRAM[ nEncoded++ ];
	
	while ( nEncoded < NES_SRAM_SIZE && nEncLen < NES_SRAM_SIZE - 133 )
	{
		chData = pGData->SRAM[ nEncoded++ ];
		
		if ( chPrevData == chData && nRunLen < 256 )
			++nRunLen;
		else
		{
			if ( nRunLen >= 4 || chPrevData == chTag )
			{
				pDstBuf[ nEncLen++ ] = chTag;
				pDstBuf[ nEncLen++ ] = chPrevData;
				pDstBuf[ nEncLen++ ] = nRunLen - 1;
			}
			else
			{
				for ( nIdx = 0; nIdx < nRunLen; ++nIdx )
					pDstBuf[ nEncLen++ ] = chPrevData;
			}
			
			chPrevData = chData;
			nRunLen = 1;
		}
		
	}
	if ( nRunLen >= 4 || chPrevData == chTag )
	{
		pDstBuf[ nEncLen++ ] = chTag;
		pDstBuf[ nEncLen++ ] = chPrevData;
		pDstBuf[ nEncLen++ ] = nRunLen - 1;
	}
	else
	{
		for ( nIdx = 0; nIdx < nRunLen; ++nIdx )
			pDstBuf[ nEncLen++ ] = chPrevData;
	}
	
	/*-------------------------------------------------------------------*/
	/*  Write a SRAM data                                                */
	/*-------------------------------------------------------------------*/
	
	// Open SRAM file
	fp = g_nes_ctx.xnes_peer_fopen_4_write( szSaveName );
	if ( fp == NULL )
		return -1;
	
	// Write SRAM data
	g_nes_ctx.xnes_peer_file_write( pDstBuf, nEncLen * 1, fp );
	
	// Close SRAM file
	g_nes_ctx.xnes_peer_file_close( fp );
	
	// Successful
	return 0;
}

/*===================================================================*/
/*                                                                   */
/*           LoadSRAM() : Load a SRAM                                */
/*                                                                   */
/*===================================================================*/
int InfoNES_LoadSRAM( const char* szSaveName )
{
/*
*  Load a SRAM
*
*  Return values
*     0 : Normally
*    -1 : SRAM data couldn't be read
	*/
	
	xnes_peer_file *fp;
	unsigned char pSrcBuf[ NES_SRAM_SIZE ];
	unsigned char chData;
	unsigned char chTag;
	int nRunLen;
	int nDecoded;
	int nDecLen;
	int nIdx;
	Nes_Global_T *pGData = &gNesGlobalData;
	
	// It is finished if the ROM doesn't have SRAM
	if ( !ROM_SRAM )
		return 0;
	
	/*-------------------------------------------------------------------*/
	/*  Read a SRAM data                                                 */
	/*-------------------------------------------------------------------*/
	
	// Open SRAM file
	fp = g_nes_ctx.xnes_peer_fopen_4_read( szSaveName );
	if ( fp == NULL )
		return -1;
	
	// Read SRAM data
	g_nes_ctx.xnes_peer_file_read( pSrcBuf, NES_SRAM_SIZE * 1, fp );
	
	// Close SRAM file
	g_nes_ctx.xnes_peer_file_close( fp );
	
	/*-------------------------------------------------------------------*/
	/*  Extract a SRAM data                                              */
	/*-------------------------------------------------------------------*/
	
	nDecoded = 0;
	nDecLen = 0;
	
	chTag = pSrcBuf[ nDecoded++ ];
	
	while ( nDecLen < 8192 )
	{
		chData = pSrcBuf[ nDecoded++ ];
		
		if ( chData == chTag )
		{
			chData = pSrcBuf[ nDecoded++ ];
			nRunLen = pSrcBuf[ nDecoded++ ];
			for ( nIdx = 0; nIdx < nRunLen + 1; ++nIdx )
			{
				pGData->SRAM[ nDecLen++ ] = chData;
			}
		}
		else
		{
			pGData->SRAM[ nDecLen++ ] = chData;
		}
	}
	
	// Successful
	return 0;
}

