/* Sound Output 5 Waves - 2 Pulse, 1 Triangle, 1 Noise, 1 DPCM */
BYTE *wave_final = NULL;
void InfoNES_SoundOutput(int samples, BYTE *wave1, BYTE *wave2, BYTE *wave3, BYTE *wave4, BYTE *wave5)
{
	int i;
	//static BYTE wave_final[1024];
	if( samples > 1024 )	samples = 1024;
	
	for( i = 0; i < samples; ++i )
	{
		wave_final[i] = (wave1[i] + wave2[i] + wave3[i] + wave4[i] + wave5[i] ) / 5;
	}
	// 	mixsnd(samples, wave_final,wave1, wave2, wave3, wave4, wave5 );
	
	g_nes_ctx.xnes_peer_sound_write( samples , wave_final );
}
